function App () {

return <div className="app">

  <div className="menubar">

  <p className="pageTitle">Handmade by Irene Arr</p>
  <img
      className="logo"
      src={logo}
      alt="Logo"
    />

  </div>

<Carousel >
  <Carousel.Item> 
    <img
      className="d-block w-6"
      src={img1}
      alt="First slide"
    />
    <Carousel.Caption>
      <h3>First slide label</h3>
      <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item class="d-flex justify-content-center">
    <img
      className="d-block w-6"
      src={img2}
      alt="Second slide"
    />

    <Carousel.Caption>
      <h3>Second slide label</h3>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-6"
